webpackJsonp([0x7f481b705953],{460:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Elvin's Blog",author:"Elvin Ma"}},markdownRemark:{id:"/Users/maxingcong/Code/blog/src/pages/RAIL性能模型笔记.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-f3cfc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.2589928057554%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="RAIL"\n        title=""\n        src="/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-fb8a0.png"\n        srcset="/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-1a291.png 148w,\n/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-2bc4a.png 295w,\n/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-fb8a0.png 590w,\n/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-526de.png 885w,\n/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-fa2eb.png 1180w,\n/blog/static/rail-72a81f5fdebe9b6ca1dc78cc6b568dc2-f3cfc.png 1390w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>RAIL is a User-centric performance model that breaks down the user’s experience into key actions.</p>\n<p>Every web app has four distinct aspects to its life cycle, and performance fits into them in different ways.</p>\n<h3>User Perception</h3>\n<p>User perception of performance delays:</p>\n<table>\n<thead>\n<tr>\n<th>Delay</th>\n<th>Perception</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>0 to 16ms</td>\n<td>Browser paint 60 frames to screen every second, leaving about 10ms for app to produce a frame.</td>\n</tr>\n<tr>\n<td>0 to 100ms</td>\n<td>Users feel like the result are immediate.</td>\n</tr>\n<tr>\n<td>100ms to 300ms</td>\n<td>A slightly perceptible delay.</td>\n</tr>\n<tr>\n<td>300ms to 1000ms</td>\n<td>Users feel part of a natural and continuous progression of tasks, like loading page or changing views.</td>\n</tr>\n<tr>\n<td>1000ms or more</td>\n<td>User lose focus on the task that is performing.</td>\n</tr>\n<tr>\n<td>10s or more</td>\n<td>User are frustrated and likely to abandon tasks.</td>\n</tr>\n</tbody>\n</table>\n<h3>Response</h3>\n<p><strong>Process events in under 50ms.</strong></p>\n<p>Don’t block the user, work in the background if possible.</p>\n<p>Actions that takes more than 50ms need to provide feedback.</p>\n<p>Idle tasks affect the input response budget.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-81927.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rail response details"\n        title=""\n        src="/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-fb8a0.png"\n        srcset="/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-1a291.png 148w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-2bc4a.png 295w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-fb8a0.png 590w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-526de.png 885w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-fa2eb.png 1180w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-08f6a.png 1770w,\n/blog/static/rail-response-details-93bebdb87aaf88dfe5b4e12893e81a87-81927.png 2400w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Animation</h3>\n<p><strong>Produce a frame in 10ms</strong></p>\n<p>Whenever possible, make use of the 100ms response budget to pre-calculate expensive work so that you maximize your chances of hitting 60fps.</p>\n<p>All interactions are considered animation:</p>\n<ol>\n<li>Visual aniamtions, such as loading indicators, tweening, entrance and exit.</li>\n<li>Scrolling, such as flinging, as the page continue to scroll after user lets go scorlling.</li>\n<li>Dragging, such as dragging a map or pinching to zoom.</li>\n</ol>\n<p>More to see: <a href="https://silentmaker.github.io/blog/rendering-performance">Rendering Performance</a></p>\n<h3>Idle</h3>\n<p><strong>Maximize idle time</strong> to increase the odds that the page responds to user input within 50ms.</p>\n<ol>\n<li>Use idle time to do deffered work, like loading a page with minium data and get the rest afterwards.</li>\n<li>Idle time tasks should be perform within 50ms or less.</li>\n<li>User interactions should have highest priority and interrupt the idle time task.</li>\n</ol>\n<h3>Load</h3>\n<p><strong>Deliver content and become interactive in under 5 seconds</strong></p>\n<p>When pages load slowly, user attention wanders, and users perceive the task as broken. Sites that load quickly have longer average sessions, lower bounce rates, and higher ad viewability.</p>\n<p>Optimize loading performance relative to the users’s network condition and device. </p>\n<p>Currently, a good target for first loads is to load the page and be interactive in 5s or less on mid-range mobile devices (such as Moto G4) with slow 3G connections. </p>\n<p>For subsequent loads, a good target is to load the page in under 2 seconds.</p>\n<ol>\n<li>Focus on optimizing <a href="https://silentmaker.github.io/blog/critical-rendering-path/">Criticl Rendering Path</a> to unblock rendering.</li>\n<li>Enable progressive rendering and do some work in the background. Defer non-essential loads to periods of idle time. </li>\n<li>Recognize the factors that affect page load performance: Network speed and latency, Hardware, Cache eviction, L2/L3 caching, Parsing javascript.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-0bad8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 49.515151515151516%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="speed metrics"\n        title=""\n        src="/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-fb8a0.png"\n        srcset="/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-1a291.png 148w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-2bc4a.png 295w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-fb8a0.png 590w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-526de.png 885w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-fa2eb.png 1180w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-08f6a.png 1770w,\n/blog/static/speed-metrics-af30b895d5a5bc08125643887a5b626b-0bad8.png 3300w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Tools</h3>\n<ul>\n<li>Chrome Devtools</li>\n<li>Lighthouse</li>\n<li>WebPageTest</li>\n</ul>',frontmatter:{title:"RAIL性能模型笔记",tags:["前端"],categories:["编程"],date:"July 26, 2018"}}},pathContext:{slug:"/RAIL性能模型笔记/",previous:{fields:{slug:"/Redux基础/"},frontmatter:{path:"/redux-cheatsheet",title:"Redux基础",tags:["Javascript"],categories:["编程"]}},next:{fields:{slug:"/Ploymer入门/"},frontmatter:{path:"/polymer-introduction",title:"Ploymer入门",tags:["Javascript"],categories:["编程"]}}}}}});
